date: number; // *\n    title: string; // *\n    description: string;\n    closedBy: string; // * , always an employee\n    closedById: string; //is '' when employee is not in database\n    amount: number; // *\n    type: 'Sale' | 'Refund' | 'Purchase' | undefined; // *\n    payer: string; // * , always a contact\n    recipient: string; // * , always a contact\n    payerId: string; //is '' when payer is not in database\n    recipientId: string; //is '' when recipient is not in database\n    id: string;\n\n\n    constructor(transfer?: any) {\n\n        if (transfer) {\n            \n            this.date = transfer.date;\n            this.title = transfer.title;\n            this.description = transfer.description ? transfer.description : '';\n            this.closedBy = transfer.closedBy;\n            this.closedById = transfer.closedById ? transfer.closedById : '';\n            this.amount = transfer.amount;\n            this.type = transfer.type;\n            this.payer = transfer.payer;\n            this.recipient = transfer.recipient;\n            this.payerId = transfer.payerId ? transfer.payerId : '';\n            this.recipientId = transfer.recipientId ? transfer.recipientId : '';\n            this.id = transfer.id ? transfer.id : '';\n\n        } else {\n\n            this.date = 0;\n            this.title = '';\n            this.description = '';\n            this.closedBy = '';\n            this.closedById = '';\n            this.amount = 0;\n            this.type = undefined;\n            this.payer = '';\n            this.recipient = '';\n            this.payerId = '';\n            this.recipientId = '';\n            this.id = '';\n        }\n    }\n\n\n    public toJSON(): object {\n\n        return {\n            date: this.date,\n            title: this.title,\n            description: this.description,\n            closedBy: this.closedBy,\n            closedById: this.closedById,\n            amount: this.amount,\n            type: this.type,\n            payer: this.payer,\n            recipient: this.recipient,\n            payerId: this.payerId,\n            recipientId: this.recipientId,\n            id: this.id\n        }\n    }\n}\n    \n\n\n\n\n\n\n\n\n\n\n                   \n    \n         results matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"components/TransferDetailComponent.html":{"url":"components/TransferDetailComponent.html","title":"component - TransferDetailComponent","body":"\n                   \n\n\n\n\n\n  Components\n  \n  TransferDetailComponent\n\n\n\n        \n            Info\n        \n        \n            Source\n        \n        \n            Template\n        \n        \n            DOM Tree\n        \n\n\n\n    \n    File\n\n\n    src/app/transfers/transfer-detail/transfer-detail.component.ts\n\n\n\n\n\n    \n        Implements\n    \n    \n                OnInit\n    \n\n\n\n    Metadata\n    \n        \n\n\n\n\n\n\n\n\n\n\n\n\n            \n                selector\n                app-transfer-detail\n            \n\n            \n                standalone\n                true\n            \n\n            \n                imports\n                \n                            MatButtonModule\n                            MatCardModule\n                            MatDividerModule\n                            MatIconModule\n                            MatMenuModule\n                            MatTooltipModule\n                            RouterModule\n                \n            \n\n\n\n\n            \n                templateUrl\n                ./transfer-detail.component.html\n            \n\n\n\n            \n                styleUrl\n                ./transfer-detail.component.scss\n            \n\n\n\n\n\n        \n    \n\n\n    \n    Index\n    \n        \n                \n                    \n                        Properties\n                    \n                \n                \n                    \n                  